import React from "react"
import "./style.css"
import { Icon } from '@iconify/react';

export default function SucessTxt(props) {
    return(
        <>
        <p className="txt flex-hcenter">{props.text}</p>
        <Icon icon="akar-icons:check" />
        </>
    )}
